INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3001, "2030/01/01 14:59:59", 2.1, 100, 2, 130011, -416.5, 3001100, "ヤマト", "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 0.0, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3001, "2030/01/01 14:59:59", 5.68, 101, 2, 130011, -416.5, 3001101, "ヤマト", "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 0.0, "2024/10/31 12:00:00", 4);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3001, "2030/01/01 14:59:59", 0.0, 102, 1, 130011, -416.5, 3001102, "ヤマト", "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 0.0, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3002, "2030/01/01 14:59:59", 0.0, 100, 1, 130211, -416.5, 3002100, "フブキ", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 0.0, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3002, "2030/01/01 14:59:59", 0.0, 101, 1, 130211, -416.5, 3002101, "フブキ", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 0.0, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3002, "2030/01/01 14:59:59", 8.53, 102, 2, 130211, -416.5, 3002102, "フブキ", "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 0.0, "2024/10/31 12:00:00", 5);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3002, "2030/01/01 14:59:59", 5.67, 103, 1, 130211, -416.5, 3002103, "フブキ", "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 0.0, "2024/10/31 12:00:00", 7);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3002, "2030/01/01 14:59:59", 0.0, 104, 1, 130211, -416.5, 3002104, "フブキ", "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 0.0, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3004, "2030/01/01 14:59:59", 0.0, 300, 3, 130211, -416.5, 3002300, "フブキ", "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 0.0, "2024/10/31 12:00:00", 3);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3005, "2030/01/01 14:59:59", 0.0, 301, 7, 130211, -416.5, 3002400, "フブキ", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 0.0, "2024/10/31 12:00:00", 7);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3003, "2030/01/01 14:59:59", 4.4, 200, 1, 130211, -416.5, 3003200, "フブキ", "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 0.0, "2024/10/31 12:00:00", 2);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3003, "2030/01/01 14:59:59", 0.0, 201, 7, 130211, -416.5, 3003201, "フブキ", "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 0.0, "2024/10/31 12:00:00", 7);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3003, "2030/01/01 14:59:59", 5.6, 202, 2, 130211, -416.5, 3003202, "フブキ", "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 0.0, "2024/10/31 12:00:00", 1);
